import React from 'react';

class ProfileTab extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            display: false
         }
    }

    changeDiplay(){
        this.setstate({display: true});
    }

    render() { 
        return (
                <h1>hello world</h1>
         );
    }
}

export default ProfileTab;
